  function planetInput({ target }) {
    console.log(target.value);
    usePlanetInput
  }

  return (
    <header>
      <form>
        <input
          className="input is-success"
          type="text"
          data-testid="name-filter"
          placeholder="Digite Um Planeta de Star Wars"
          onChange={ planetInput }
        />
      </form>
    </header>
  );
}

export default Header;
